--
-- Table structure for table `lkpy_fish`
--

DROP TABLE IF EXISTS `lkpy_fish`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `lkpy_fish` (
  `id` int(11) NOT NULL DEFAULT '0' COMMENT '鱼id',
  `bbxId` int(11) DEFAULT NULL COMMENT '包围盒id',
  `lockLeve` int(11) DEFAULT NULL COMMENT '锁定等级',
  `type` int(11) DEFAULT NULL COMMENT '鱼类型(1:普通鱼,2:同类炸弹,3:全屏炸弹)',
  `fishs` varchar(64) DEFAULT NULL COMMENT '同类炸弹鱼种类',
  `minRate` int(11) DEFAULT NULL COMMENT '最小倍率',
  `maxRate` int(11) DEFAULT NULL COMMENT '最大倍率',
  `deathStrategy` int(11) DEFAULT NULL COMMENT '鱼死亡后的刷鱼策略id',
  `noticeType` int(11) DEFAULT NULL COMMENT '公告类型(0:无公告,1:全服公告,2:本房间公告)',
  `noticeContent` varchar(1024) DEFAULT NULL COMMENT '公告内容',
  `desc` varchar(1024) DEFAULT NULL COMMENT '描述',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
