DROP TABLE IF EXISTS `wknh_room`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `wknh_room` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '房间id',
  `name` varchar(255) DEFAULT NULL COMMENT '房间名称',
  `phone` int(11) DEFAULT NULL COMMENT '平台类型（1是，0否）',
  `type` int(11) DEFAULT NULL COMMENT '房间类型(jcby_room_type)',
  `scences` varchar(128) DEFAULT NULL COMMENT '鱼的场景',
  `liKui` int(11) DEFAULT NULL COMMENT '李逵的fishId',
  `exchangePer` int(11) DEFAULT NULL COMMENT '每次兑换鱼币的金币数量',
  `powerBatteryMultiple` int(11) DEFAULT NULL COMMENT '能量炮出现倍率',
  `powerBatteryPro` int(11) DEFAULT NULL COMMENT '能量炮出现概率(万分比)',
  `powerBatteryTime` int(11) DEFAULT NULL COMMENT '能量炮时间(秒)',
  `maxNum` int(11) DEFAULT NULL COMMENT '房间最大人数',
  `free` int(11) DEFAULT NULL COMMENT '空闲状态人数',
  `general` int(11) DEFAULT NULL COMMENT '普通状态人数',
  `crowded` int(11) DEFAULT NULL COMMENT '拥挤状态人数',
  `lower` int(11) DEFAULT NULL COMMENT '进入下限',
  `upper` int(11) DEFAULT NULL COMMENT '进入上限',
  `ordinarPeople` int(11) DEFAULT NULL COMMENT '普通玩家进入人数百分比',
  `proportionGold` int(11) DEFAULT NULL COMMENT '金币与筹码比例（金币）',
  `proportionChips` int(11) DEFAULT NULL COMMENT '金币与筹码比例（筹码）',
  `table` int(11) DEFAULT NULL COMMENT '桌子数',
  `chair` int(11) DEFAULT NULL COMMENT '每桌椅子数',
  `afee` int(11) DEFAULT NULL COMMENT '台费(进桌扣一次)',
  `inType` int(11) DEFAULT NULL COMMENT '进入类型（0点击入座，1自动分配）',
  `displays` varchar(255) DEFAULT NULL COMMENT '客户端展示的属性列信息',
  `placeHolder` varchar(255) DEFAULT NULL COMMENT '客户端展示的属性列信息占位符',
  `isActive` tinyint(4) DEFAULT NULL COMMENT '状态(0:关闭,1:开启)',
  `timeCreate` datetime DEFAULT NULL COMMENT '创建时间',
  `timeOpen` datetime DEFAULT NULL COMMENT '开启时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;
